css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("testyonline.grupaimage.eu") {
  html, body{
    background: #2e2e2e !important;
  }
  .btn-group {
    background: #2e2e2e !important;   
  }
  #wrapper > header.default { 
    background: #2e2e2e !important;   
  } 
  #wrapper > header.default .logo.company-logo {
    background: #f5f0e9 !important;
  }
  #wrapper > section.content > #page-container > section.asset .asset-box .asset-preview-image {
   background: #2e2e2e !important; 
  }
  .asset-box.asset-box-image{
    background: #2e2e2e !important;
  }
  .asset-box.asset-box-video{
    background: #2e2e2e !important;
  }
  .nav-panel {
    background: #330000 !important;    
  }
  .answer.answer-yes {
    background: #669900 !important;
  }
  .answer.answer-yes.selected {
    font-size: 40px !important;
    background: #336600 !important;
  }
  .answer.answer-no {
    background: #993300 !important; 
  }
  .answer.answer-no.selected {
    font-size: 40px !important;
    background: #660000 !important;
  }
}
